//Main
$(document).ready(function () {

    $(window).resize(function () {
        setSidebarHeight();
        centerElement('.login-box');
    });
    setSidebarHeight();
    centerElement('.login-box');

    $("#container").on('click-row.bs.table', function (e, row, $element) {
        window.location = $element.data('href');
    });

    $(".clickable-row").click(function () {
        window.location = $(this).data("href");
    });
    // Some options to pass to the uploader are discussed on the next pag
});

function setSidebarHeight() {
    var dynamic = void 0,
        sidebar = void 0;
    dynamic = $(document).height() - $('#lc_header').outerHeight();
    sidebar = $('#lc_sidebar');

    sidebar.css({
        'min-height': dynamic,
        'max-height': dynamic
    });
}

function centerElement(element) {

    //Errechnete Werte anwenden
    $(element).css({
        'margin-top': ($(window).height() - $(element).outerHeight()) / 2
    });
}

